import React from 'react';

const Nav = () => {
    return (
        <ul>
            <Link to={'/'}>Home</Link>
            <Link to={'/campuses'}>Campuses</Link>
            <Link to={'/star-wars-people'}>Star Wars</Link>
        </ul>
    )
}

export default Nav;
